The Cartesian product of two sets A and B, denoted as A x B, is the set of all ordered pairs (a, b) where a is an element of A and b is an element of B.

Let's find A x B and B x A:

A x B = {(a, b) | a ∈ A, b ∈ B}
A = {1, 2, 3}
B = {4, 5}

A x B = {(1, 4), (1, 5), (2, 4), (2, 5), (3, 4), (3, 5)}

Now let's find B x A:

B x A = {(b, a) | b ∈ B, a ∈ A}
B = {4, 5}
A = {1, 2, 3}

B x A = {(4, 1), (4, 2), (4, 3), (5, 1), (5, 2), (5, 3)}

Now, let's compare A x B and B x A:

A x B = {(1, 4), (1, 5), (2, 4), (2, 5), (3, 4), (3, 5)}
B x A = {(4, 1), (4, 2), (4, 3), (5, 1), (5, 2), (5, 3)}

As we can see, the ordered pairs in A x B are not the same as the ordered pairs in B x A. The elements in the pairs are the same, but their order is different. Therefore, A x B is not equal to B x A.
